import { Card, Space } from "antd";

function TestCard() {
  return (
    <div>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title={
          <div>
            <b>SSID: </b>Aegis Research
          </div>
        }
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26" }}
      >
        <Space size={16}>
          <p>Network Status:</p>{" "}
          <p style={{ color: "#45d5c9" }}>
            <b>ACTIVE</b>
          </p>
        </Space>
        <Space size={21}>
          <p>Protocol Type:</p>{" "}
          <p>
            <b>Wi-Fi 5 (802.11ac)</b>
          </p>
        </Space>
        <Space size={22}>
          <p>Security Type:</p>{" "}
          <p>
            <b>WPA2-Enterprise </b>
          </p>
        </Space>
        <Space size={14}>
          <p>IPv4 DNS Server</p>{" "}
          <p>
            <b>192.168.1.1</b>
          </p>
        </Space>
      </Card>
    </div>
  );
}

export default TestCard;
